import { WALLET_API } from 'Helper/constant';
import useFetch from 'Hooks/useFetch';
import VendingMachine from 'Pages/VendingMachine';
import React from 'react';

const WalletMoneyContext = React.createContext();

function App() {
  const [walletMoney, setWalletMoney] = useFetch(WALLET_API);

  return (
    <WalletMoneyContext.WalletMoneyContext.Provider
      walletMoney={WalletMoney}
      setWalletMoney={setWalletMoney}
    >
      <VendingMachine walletMoney={walletMoney} />
    </WalletMoneyContext.WalletMoneyContext.Provider>
  );
}

export default App;
